export function getOtherName(id, lang) {
  let result;
  fetch(`https://xivapi.com/Action/${id}?columns=Name_en,Name_ja,Name_de,Name_fr`, { mode: "cors" })
    .then((response) => response.json())
    .then((data) => {
      result = data[`Name_${lang}`];
    })
    .catch((e) => {
      return actions[id];
    });
  return result;
}

function createIconUrl(icon) {
  if (!icon) return;
  let head = [..."000000"];
  let iconStr = icon.toString();
  if (iconStr.length > 3) {
    const temp = [...iconStr].slice(0, iconStr.length - 3).concat(..."000");
    head = [...head.slice(0, 6 - temp.length), ...temp];
  }
  let foot = [..."000000"];
  foot = [...foot.slice(0, 6 - iconStr.length), ...iconStr];
  return `${head.join("")}/${foot.join("")}`;
}

